import styled from "styled-components";
import '../App.css';
import { Routes, Route, Link } from 'react-router-dom';
import SignIn from '../sign_up_in/SignIn.js';
import PublicRoutes from "../PublicRoutes";

const HeaderContainer = styled.div`
  background-color: #A0CED9;
  width: 100%;
  display: flex;
  justify-content: space-around;
  a{
    margin: 15px;
    color: white;
    font-size: 20px;
    font-weight: normal;
  }
  p{
    margin: 0 auto;
    color: white;
    font-size: 20px;
    font-weight: normal;
  }
`

const PersonalArea = styled.div`
  height: 50px;
  background-color: #1F2041;
`

const Rules = styled.div`
  background-color: #1F2041;
`

const SignUpIn = styled.div`
  background-color: #1F2041;
`

const Header = () => {
  return (
    <HeaderContainer>
      <PersonalArea>
        <p>Личный кабинет</p>
      </PersonalArea>
      <Rules>
        <p>Правила использования</p>
      </Rules>
        <SignUpIn>
          <Link to='/SignIn'>Войти</Link>
        </SignUpIn>
    </HeaderContainer>
  );
}

export default Header;
